import React from 'react';
const Layout= () =>{
    return(
        <div>
            <div class="container">
                <div class="flex-start item1 item-1">
                   <p> Cậu có người yêu chưa?</p>
                     <div class="item1 item-2">
                    <p>Có rồi!</p>
                </div>
                <div>
                <a href="/layout" className="btn btn-outline-warning" role="button" aria-disabled="true">
                    Chưa có!</a> 
                </div>
                </div>
            </div>
        </div>
    )
}
export default React.memo(Layout);
